function filterDates(t1){
    t1.sort((a,b) => new Date(a.date).getTime() - new Date(b.date).getTime())
    return t1
}

function filterStates(t1, stateList){
    if (stateList.length > 0){
        t1 = t1.filter(i => stateList.includes(i.state.split(',').slice(-1).toString().trim(), 0)) // filter states
    }
    return t1
}

function filterNames(){
    
}

export default {filterDates, filterStates, filterNames}
